from argparse import ArgumentParser
from json import dumps, loads
import subprocess
import re
import time
import tempfile
import os

# We parse the command line arguments.
parser = ArgumentParser(description="run all fuzzing campaigns")
parser.add_argument(
    "--fuzzer-name",
    metavar="N",
    type=str,
    nargs="?",
    default="harvey",
    help="name of the fuzzer that should be used",
)
args = parser.parse_args()

fuzzer_name = args.fuzzer_name
docker_image = "harvey-cli:0.0.113"
fuzzer_exe = "../harvey-cli/harvey-cli"
if fuzzer_name == "echidna":
    docker_image = "ghcr.io/crytic/echidna/echidna:v2.1.1"
elif fuzzer_name == "foundry":
    docker_image = "ghcr.io/foundry-rs/foundry@sha256:e3ba202249cccdffafc0d0e90c43baca8f03e4b0d7e273c0d33b8a5e3cea1eb7"
elif fuzzer_name == "hybrid-echidna":
    docker_image = "hybrid-echidna:v0.0.2"
elif fuzzer_name == "ityfuzz":
    docker_image = "fuzzland/ityfuzz:print-logs"
time_limit = 28800
include_raw_output = False
maze_id_start = 0
maze_id_end = 5
rnd_seed_start = 0
rnd_seed_end = 8
cores_start = 1
cores_end = 41
memory_limit = 32000
# We have compiled each contract to get its creation bytecode (using solc 0.8.19+commit.7dd6d404 with 200 optimizer runs).
maze_code = dict(
    {
        0: "",
        1: "",
        2: "",
        3: "",
        4: "",
    }
)


def create_all_tasks():
    tasks = []
    for maze_id in range(maze_id_start, maze_id_end):
        for rnd_seed in range(rnd_seed_start, rnd_seed_end):
            task = {
                "proc": None,
                "maze-id": maze_id,
                "rnd-seed": rnd_seed,
                "core-id": -1,
                "result": None,
            }
            tasks.append(task)
    return tasks


tasks = create_all_tasks()


def process_all_tasks(tasks):
    is_done = dict({})
    free_cores = set(range(cores_start, cores_end))
    while True:
        all_done = True
        for task_idx, task in enumerate(tasks):
            if is_done.get(task_idx, False):
                continue
            proc = task["proc"]
            if proc is None:
                all_done = False
                if len(free_cores) < 1:
                    time.sleep(5)
                    continue
                core_id = free_cores.pop()
                task["core-id"] = core_id

                maze_id = task["maze-id"]
                rnd_seed = task["rnd-seed"]

                exe = [fuzzer_exe]
                if docker_image != "":
                    if fuzzer_name == "harvey":
                        exe = [
                            "docker",
                            "run",
                            "--rm",
                            "-i",
                            f"--cpuset-cpus={core_id}",
                            f"--memory={memory_limit}m",
                            f"--memory-swap={memory_limit}m",
                            f"{docker_image}",
                        ]
                    elif fuzzer_name == "echidna":
                        wd = os.getcwd()
                        exe = [
                            "docker",
                            "run",
                            "--rm",
                            "-i",
                            f"--cpuset-cpus={core_id}",
                            f"--memory={memory_limit}m",
                            f"--memory-swap={memory_limit}m",
                            f"--mount=type=bind,source={wd},target=/daedaluzz",
                            "--workdir=/daedaluzz",
                            '--entrypoint="./run-echidna.sh"',
                            f"{docker_image}",
                            f"{task_idx} {time_limit} {maze_id} {rnd_seed}",
                        ]
                    elif fuzzer_name == "foundry":
                        wd = os.getcwd()
                        exe = [
                            "docker",
                            "run",
                            "--rm",
                            "-i",
                            f"--cpuset-cpus={core_id}",
                            f"--memory={memory_limit}m",
                            f"--memory-swap={memory_limit}m",
                            f"--mount=type=bind,source={wd},target=/daedaluzz",
                            "--workdir=/daedaluzz",
                            '--entrypoint="./run-foundry.sh"',
                            f"{docker_image}",
                            f"{task_idx} {time_limit} {maze_id} {rnd_seed}",
                        ]
                    elif fuzzer_name == "hybrid-echidna":
                        wd = os.getcwd()
                        exe = [
                            "docker",
                            "run",
                            "--rm",
                            "-i",
                            f"--cpuset-cpus={core_id}",
                            f"--memory={memory_limit}m",
                            f"--memory-swap={memory_limit}m",
                            f"--mount=type=bind,source={wd},target=/daedaluzz",
                            "--workdir=/daedaluzz",
                            '--entrypoint="./run-hybrid-echidna.sh"',
                            f"{docker_image}",
                            f"{task_idx} {time_limit} {maze_id} {rnd_seed}",
                        ]
                    elif fuzzer_name == "ityfuzz":
                        wd = os.getcwd()
                        exe = [
                            "docker",
                            "run",
                            "--rm",
                            "-i",
                            f"--cpuset-cpus={core_id}",
                            f"--memory={memory_limit}m",
                            f"--memory-swap={memory_limit}m",
                            f"--mount=type=bind,source={wd},target=/daedaluzz",
                            "--workdir=/daedaluzz",
                            '--entrypoint="./run-ityfuzz.sh"',
                            f"{docker_image}",
                            f"{task_idx} {time_limit} {maze_id} {rnd_seed}",
                        ]
                out_file = tempfile.NamedTemporaryFile(mode="w+t")
                if fuzzer_name == "harvey":
                    config = dict(
                        {
                            "code": maze_code[maze_id],
                            "time-limit-secs": time_limit,
                            "emit-mythx-report": True,
                            "assertion-checking-mode": 2,
                            "num-cores": 1,
                            "random-seed": rnd_seed,
                            "try-to-identify-contracts-by-metadata-hash": True,
                            "emit-high-novelty-sequences-only": True,
                            "enable-cheat-codes": False,
                            "chain-configuration": dict(
                                {
                                    "chain-id": "1",
                                }
                            ),
                        }
                    )
                    json_config = dumps(
                        config, sort_keys=True, indent=4, separators=(",", ": ")
                    )
                    fuzzer_input = f"{json_config}"
                    in_file = tempfile.NamedTemporaryFile(mode="w+t")
                    in_file.write(fuzzer_input)
                    in_file.flush()
                    in_file.seek(0)
                    proc = subprocess.Popen(
                        exe,
                        stdin=in_file,
                        stdout=out_file,
                        stderr=out_file,
                        text=True,
                    )
                elif (
                        fuzzer_name == "echidna"
                        or fuzzer_name == "foundry"
                        or fuzzer_name == "hybrid-echidna"
                        or fuzzer_name == "ityfuzz"
                ):
                    proc = subprocess.Popen(
                        " ".join(exe),
                        stdout=out_file,
                        stderr=out_file,
                        text=True,
                        shell=True,
                    )
                task["proc"] = proc
                task["out-file"] = out_file
                task["start-time"] = time.time_ns()
                continue
            rc = proc.poll()
            if rc is None:
                all_done = False
                continue
            is_done[task_idx] = True
            free_cores.add(task["core-id"])
            out_file = task["out-file"]
            out_file.seek(0)
            fuzzer_output = out_file.read()
            if fuzzer_name == "harvey":
                json_output = loads(fuzzer_output)
                fuzzer_result = json_output[0]
                duration = fuzzer_result["meta"]["harveyAnalysisDuration"]
                issues = fuzzer_result["issues"]
                violations = dict({})
                for issue in issues:
                    msg = issue["description"]["tail"]
                    m = re.match(
                        "A user-provided assertion failed with the message '(.*)'.", msg
                    )
                    t = issue["extra"]["discoveryTime"]
                    violations[m[1]] = t
            elif fuzzer_name == "echidna":
                duration = time.time_ns() - task["start-time"]
                violations = dict({})
                ms = re.findall(
                    r'^\s*\d+\s*\|\s*[*roe]\s*\|\s*emit AssertionFailed\("(\d+)"\)',
                    fuzzer_output,
                    flags=re.M,
                )
                for m in ms:
                    violations[m] = duration
            elif fuzzer_name == "foundry":
                duration = time.time_ns() - task["start-time"]
                violations = dict({})
                timestamp_split_regex = re.compile(r"(\{\"\S+\"\: \d+})")
                timestamp_regex = re.compile(r"\{\"\S+\"\: (\d+)}")
                outs = timestamp_split_regex.split(fuzzer_output)
                curr_timestamp = 0
                start_timestamp = 0
                num_outs = len(outs)
                for out_idx, out in enumerate(outs):
                    m = timestamp_regex.fullmatch(out)
                    if m:
                        new_timestamp = int(m[1])
                        if curr_timestamp < 1:
                            start_timestamp = new_timestamp
                        curr_timestamp = new_timestamp
                        continue
                    dur = duration
                    next_idx = out_idx + 1
                    if next_idx < num_outs:
                        next_out = outs[next_idx]
                        m = timestamp_regex.fullmatch(next_out)
                        if m:
                            dur = int(m[1]) - start_timestamp
                    ms = re.findall(
                        r"\[FAIL\. Reason: Assertion failed\.\].*? invariant_(\d+)",
                        out,
                        flags=re.M | re.S,
                    )
                    for m in ms:
                        if not (m in violations):
                            violations[m] = 1000000000 * dur
            elif fuzzer_name == "hybrid-echidna":
                duration = time.time_ns() - task["start-time"]
                violations = dict({})
                timestamp_split_regex = re.compile(r"(\{\"\S+\"\: \d+})")
                timestamp_regex = re.compile(r"\{\"\S+\"\: (\d+)}")
                outs = timestamp_split_regex.split(fuzzer_output)
                curr_timestamp = 0
                start_timestamp = 0
                num_outs = len(outs)
                for out_idx, out in enumerate(outs):
                    m = timestamp_regex.fullmatch(out)
                    if m:
                        new_timestamp = int(m[1])
                        if curr_timestamp < 1:
                            start_timestamp = new_timestamp
                        curr_timestamp = new_timestamp
                        continue
                    dur = duration
                    next_idx = out_idx + 1
                    if next_idx < num_outs:
                        next_out = outs[next_idx]
                        m = timestamp_regex.fullmatch(next_out)
                        if m:
                            dur = int(m[1]) - start_timestamp
                    ms = re.findall(
                        r'^.*?\s*\d+\s*\|\s*[*roe]\s*\|\s*emit AssertionFailed\("(\d+)"\)',
                        out,
                        flags=re.M,
                    )
                    for m in ms:
                        if not (m in violations):
                            violations[m] = 1000000000 * dur
            elif fuzzer_name == "ityfuzz":
                from eth_abi import abi
                duration = time.time_ns() - task["start-time"]
                violations = dict({})
                ms = re.findall(
                    r'log@(\d+) \"([0-9a-z]+)\"',
                    fuzzer_output,
                    flags=re.M,
                )
                for (ts, log_msg) in ms:
                    violations[ts - task["start-time"]] = abi.decode(['string'], bytes.fromhex(log_msg))

            maze_id = task["maze-id"]
            rnd_seed = task["rnd-seed"]
            res = dict(
                {
                    "program": f"maze-{maze_id}.sol",
                    "tool": fuzzer_name,
                    "random-seed": rnd_seed,
                    "duration": duration,
                    "violations": violations,
                }
            )
            if include_raw_output:
                res["raw-output"] = fuzzer_output
            task["result"] = res
        if all_done:
            break


def write_output_file(tasks):
    all_results = []
    for task in tasks:
        res = task["result"]
        if res is None:
            continue
        all_results.append(res)
    output_file_name = f"{fuzzer_name}-results.json"
    with open(output_file_name, "w", encoding="utf-8") as f:
        f.write(dumps(all_results, sort_keys=True, indent=4, separators=(",", ": ")))


try:
    process_all_tasks(tasks)
finally:
    for task in tasks:
        proc = task["proc"]
        if proc is None:
            continue
        rc = proc.poll()
        if not (rc is None):
            continue
        proc.terminate()
        try:
            proc.wait(1)
        except TimeoutExpired:
            proc.kill()
            continue
    write_output_file(tasks)
